    fn next(&mut self) -> Option<Self::Item> {
        match self.iter.next() {
            Some(item) => match item {
                Ok(item) => {
                    if !self.seen.contains(&item.id()) {
                        self.seen.push(item.id());
                        Some(Ok(item))
                    } else {
                        self.next()
                    }
                }
                _ => Some(item),
            },
            None => None,
        }
    }
}

